    const {product} = props;   
    console.log(Product.category)
  return(
    <div className='breadcrum'>
      HOME<img src={arrwo_icon} alt='img'/> SHOP <img src={arrwo_icon}/> {product.category} <img src={arrwo_icon}/> {product.name }
